import { useForm } from 'react-hook-form';

export default function Register() {
  const { register, handleSubmit, formState: { errors } } = useForm({
    defaultValues: {
      firstName: '',
    }
  });
  const onSubmit = data => console.log(data);

  return (
    <>
    <form onSubmit={handleSubmit(onSubmit)}>
      <div className="name-row">
      <input 
        {...register("firstName", {

        required: true,
        minLength: 2,
        maxLength: 16,
        pattern: /^[a-z,A-Z ,.'-]$/
        })}
        name="firstName"
      />
      {errors.firstName && errors.firstName.type === "required" && <span>Enter first name</span>}
      {errors.firstName && errors.firstName.type === "pattern" && <span>Enter a valid name</span>}
      <input 
        {...register("lastName", {

        required: true,
        minLength: 2,
        maxLength: 16,
        pattern: /^[a-z,A-Z ,.'-]$/
        })}
        name="lastName"
      />

      </div>

      <input type="submit"/>
    </form>
    </>
  )
}
